import React from "react";
import { Navbar, NavbarBrand, Container } from "react-bootstrap";
import { SocialIcon } from "react-social-icons";

class Footer extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="fixed-bottom bg-light d-flex justify-content-center">
          <Navbar color="dark" dark>
            <Container>
              <NavbarBrand className="h6 small">
                Desarrollado por Mart√≠n Madridejos
              </NavbarBrand>
              
              <FontAwesomeIcon className="mr-3" icon={faFacebookF} url="https://www.facebook.com/Academia-Badalona-Jiujitsu-105699827432603/" />
              <FontAwesomeIcon className="mr-3" icon={faInstagram} />
              <FontAwesomeIcon className="mr-3" icon={faLinkedin} />
            </Container>
          </Navbar>
        </div>
      </React.Fragment>
    );
  }
}

export default Footer;
